      {name: "card3", color: "blue"},
      {name: "card4", color: "purple"}
    ]
  }
  return (
    <div className="App">
      <h1>Shell Game</h1>
      <Card></Card>
      <Card></Card>
      <Card></Card>
    </div>
  );
}

